func (c *current) onRootExpression1(expr any) (any, error) {
	return expr.(ast.Expression), nil
}

func (p *parser) callonRootExpression1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onRootExpression1(stack["expr"])
}

func (c *current) onImpliesExpr1(left, rest any) (any, error) {
	if rest == nil {
		return left.(ast.Expression), nil
	}
	parts := rest.([]interface{})
	right := parts[3].(ast.Expression)
	return &ast.LogicInfixExpression{
		Operator: "⇒",
		Left:     left.(ast.Expression),
		Right:    right,
	}, nil
}

func (p *parser) callonImpliesExpr1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onImpliesExpr1(stack["left"], stack["rest"])
}

func (c *current) onEquivExpr1(left, rest any) (any, error) {
	result := left.(ast.Expression)
	if rest != nil {
		for _, r := range rest.([]interface{}) {
			parts := r.([]interface{})
			right := parts[3].(ast.Expression)
			result = &ast.LogicInfixExpression{
				Operator: "≡",
				Left:     result,
				Right:    right,
			}
		}
	}
	return result, nil
}

func (p *parser) callonEquivExpr1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onEquivExpr1(stack["left"], stack["rest"])
}

