func (c *current) onEscapeSequence1(seq any) (any, error) {
	seqBytes := seq.([]byte)
	if len(seqBytes) > 0 {
		switch seqBytes[0] {
		case '"':
			return "\"", nil
		case '\\':
			return "\\", nil
		case 'n':
			return "\n", nil
		case 't':
			return "\t", nil
		case 'r':
			return "\r", nil
		case 'f':
			return "\f", nil
		}
	}
	return string(seqBytes), nil
}

